plot

A film about two homicide detectives' desperate hunt for a serial killer who justifies his crimes as absolution for the world's ignorance of the Seven Deadly Sins. The movie takes us from the tortured remains of one victim to the next as the sociopathic &quot;John Doe&quot; sermonizes to Detectives Sommerset and Mills -- one sin at a time. The sin of Gluttony comes first and the murderer's terrible capacity is graphically demonstrated in the dark and subdued tones characteristic of film noir. The seasoned and cultured but jaded Sommerset researches the Seven Deadly Sins in an effort to understand the killer's modus operandi while the bright but green and impulsive Detective Mills scoffs at his efforts to get inside the mind of a killer... 

cast

Brad Pitt as Detective David Mills
Morgan Freeman as Detective Lt. William Somerset
Gwyneth Paltrow as Tracy Mills
R. Lee Ermey as Police Captain
Daniel Zacapa as Detective Taylor
John Cassini as Officer Davis
Bob Mack as Gluttony Victim
Peter Crombie as Dr. O'Neill 


